716915","status":"completed"},"tags":[]},"source":[]},{"cell_type":"markdown","id":"464bf466","metadata":{"papermill":{"duration":0.009154,"end_time":"2024-03-11T22:15:00.745523","exception":false,"start_time":"2024-03-11T22:15:00.736369","status":"completed"},"tags":[]},"source":["INTRODUCTION:\n","\n","This case study is part of the Google Data Analytics Professional Certificate. The certificate program covers the data analysis process.\n","\n","In my notebook I would like to showcase all my learnings and knowledge to analyze the dataset by using all the six phases of data analysis process like: 1.Ask 2.Prepare 3.Process 4.Analyze 5.Share 6.Act\n","\n","Introduction: The case study explores the business problem of a hypothetical bike-sharing service in Chicago, Cyclistic. The data used in this case study is sourced from Motivate International Inc. The bike sharing company wants to analyze their user data to find the main differences in behaviour between their two types of users, the “casual” who pays for each ride and the annual member who pays a yearly subscription to the service.\n","\n","PHASE 1 : ASK Key objectives: 1.Identify the business task:\n","\n","Find differences between members and casual riders in the use of the bike share service and propose ways to convert casual riders into members based on their behaviour in order to further improve the company's financial position.\n","\n","2.Consider key stakeholders:\n","\n","The main stakeholders here are the director of marketing and my manager Lily Moreno, the rest of the marketing analytics team, and the Cyclistic executive team\n","\n","How do annual members and casual riders use Cyclistic bikes differently?\n","How to motivate the casual riders to opt for annual membership?\n","PHASE 2 : Prepare Key objectives: 1.Determine the credibility of the data:\n","\n","Investigate the data source and gain familiarity with the data organization.\n","\n","The data used in this case study is courtesy of a publicly available repository of monthly datasets from Motivate International Inc. The datasets are available for download here and consist of 'csv' files.\n","\n","The datasets from the previous 12 months have been downloaded from this Kaggle dataset.\n","\n","2.Sort and filter the data:\n","\n","For this analysis I'm going to focus on the 2022 period as it's the more relevant period to the business task and it has the more complete data with geo-location coordinates, and types of bike used."]},{"cell_type":"code","execution_count":3,"id":"c64ad027","metadata":{"_kg_hide-output":false,"execution":{"iopub.execute_input":"2024-03-11T22:15:00.768077Z","iopub.status.busy":"2024-03-11T22:15:00.766141Z","iopub.status.idle":"2024-03-11T22:15:01.192534Z","shell.execute_reply":"2024-03-11T22:15:01.190705Z"},"papermill":{"duration":0.439991,"end_time":"2024-03-11T22:15:01.194951","exception":false,"start_time":"2024-03-11T22:15:00.75496","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[36mℹ\u001b[39m Google's Terms of Service: \u001b[3m\u001b[34m\u001b[3m\u001b[34m<https://mapsplatform.google.com>\u001b[34m\u001b[3m\u001b[39m\u001b[23m\n","\n","\u001b[36mℹ\u001b[39m Please cite \u001b[34m\u001b[34mggmap\u001b[34m\u001b[39m if you use it! Use `citation(\"ggmap\")` for details.\n","\n"]}],"source":["# Loading Libraries required for this project\n","library(tidyverse)\n","library(lubridate)\n","library(ggmap)\n","library(geosphere)\n","library(leaflet)\n"]},{"cell_type":"code","execution_count":4,"id":"8106eeea","metadata":{"execution":{"iopub.execute_input":"2024-03-11T22:15:01.218125Z","iopub.status.busy":"2024-03-11T22:15:01.216027Z","iopub.status.idle":"2024-03-11T22:16:47.451033Z","shell.execute_reply":"2024-03-11T22:16:47.449086Z"},"papermill":{"duration":106.249836,"end_time":"2024-03-11T22:16:47.454257","exception":false,"start_time":"2024-03-11T22:15:01.204421","status":"completed"},"tags":[]},"outputs":[],"source":["#Download t