rea.\n","\n","As per basic rules of marketing we should consider the 4P's .\n","Product- Company should consider to add more electic bikes as Casual members prefer to ride for longer duration.\n","Price- Casual memebers can be converted into subscribed members if they are getting some price benefits during the peak seasons.Price discount can also helps in customer retention.\n","Place- The coastal ares are the most visited places for the Casual members so the promotions can be displayed more in the coastal areas.\n","Promotion- Company can consider more  promotional discount during the peak seasons and weekends. It should consider to include trip duration in the promotional strategy."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":3113593,"sourceId":5364724,"sourceType":"datasetVersion"}],"dockerImageVersionId":30433,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":610.953724,"end_time":"2024-03-11T22:25:06.903352","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-03-11T22:14:55.949628","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}